  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (1,522 records)
  were compiled by the Portland State University. This data base was received in August
  1990. Principal gravity parameters include Free-air Anomalies and Complete Bouguer
  Anomalies (terrain correction applied). The observed gravity values are referenced
  to the International Gravity Standardization Net 1971 (IGSN 71). The gravity anomaly
  computation uses the Geodetic Reference System 1967 (GRS 67) theoretical gravity
  formula. The data are randomly distributed within the boundaries of the greater
  Portland area.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
